import React from "react";
import { Card, Icon, Image ,Grid} from 'semantic-ui-react' 


export default class Pourquoi extends React.Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
            <div>
                <h1 style={{fontFamily:"Comic sans MS",textAlign:"center",paddingTop:150}}>Pourquoi choisir le remplacement de votre systeme de chauffage</h1>
                <Grid columns={3} divided>
                    <Grid.Row>
                      <Grid.Column>
                            <Card>
                                <Image src='img/ecolo/badge-france.png' wrapped ui={false} />
                                    <Card.Content>
                                        <Card.Header>Daniel</Card.Header>
                                        <Card.Meta>Joined in 2016</Card.Meta>
                                            <Card.Description>
                                                Daniel is a comedian living in Nashville.
                                            </Card.Description>
                                    </Card.Content>
                                        <Card.Content extra>
                                            <a><Icon name='user' />10 Friends</a>
                                    </Card.Content>
                            </Card>
                        </Grid.Column>  
                    </Grid.Row>
                    </Grid>
            </div>


        )
    }
}
